import axios from "axios";
import React, { useState, useEffect } from "react";

function NewSale() {
    var productName;
    const [product, setProduct] = useState([]);
    

    const getProduct = async () => {
		try {
			const response = await axios.get('/products');
			const jsonData = await response.data;

			console.log(jsonData);
			setProduct(jsonData);
		}catch(err){
			console.error(err.message);
		}
	}

	useEffect(() => {
		getProduct();
	}, []);
    let prod = product.map((pro) => {
        return(
            <option value={pro.name}>{pro.name}</option>
        )
    })
    return (
        <div className="text-white py-4 w-8/12 px-4">
            <div class="mb-6">
                <div class="">
                    <div class="mb-3 xl:w-70">
                        Product
                        <select class="form-select appearance-none
                                    block
                                    w-full
                                    px-3
                                    py-1.5
                                    text-base
                                    font-normal
                                    text-gray-700
                                    bg-white bg-clip-padding bg-no-repeat
                                    border border-solid border-gray-300
                                    rounded
                                    transition
                                    ease-in-out
                                    m-0
                                    focus:text-gray-700 focus:bg-white focus:border-blue-600 focus:outline-none" aria-label="Default select example" onChange={(event) => productName = event.target.value}>
                            <option selected> Click To Select A Product</option>
                            {prod}
                        </select>
                    </div>
                </div>
                <div class="mb-6">
                    <label for="default-input" className="block mb-2 text-sm font-medium text-gray-900 dark:text-gray-300">Default input</label>
                    <input type="text" id="default-input" className="bg-gray-50 border border-gray-300 text-gray-900 text-sm rounded-lg focus:ring-blue-500 focus:border-blue-500 block w-full p-2.5 dark:bg-gray-700 dark:border-gray-600 dark:placeholder-gray-400 dark:text-white dark:focus:ring-blue-500 dark:focus:border-blue-500" />
                </div>
            </div>
        </div>
    )
}

export default NewSale;
